class Solution {

    /**
     * @param Integer $n
     * @param Integer[] $rollMax
     * @return Integer
     */
    function dieSimulator($n, $rollMax) {
        $mod = 10**9 + 7;
        $dp = array_fill(0, $n + 1, array_fill(0, 7, 0));
        $dp[0][0] = 1;
        for ($i = 1; $i <= $n; $i++) {
            for ($j = 1; $j <= 6; $j++) {
                if ($i <= $rollMax[$j - 1]) {
                    $dp[$i][$j] = ($dp[$i - 1][0] + $dp[$i - 1][$j]) % $mod;
                } else {
                    $dp[$i][$j] = ($dp[$i - 1][0] + $dp[$i - 1][$j] - ($i < $rollMax[$j - 1] ? $dp[$i - 1][$j] : $dp[$i - $rollMax[$j - 1] - 1][$j])) % $mod;
                    if ($dp[$i][$j] < 0) $dp[$i][$j] += $mod;
                }
            }
        }
        return array_sum($dp[$n]) % $mod;
    }
}

class Solution {

    /**
     * @param Integer $n
     * @param Integer[][] $edges
     * @return Integer[]
     */
    function countSubgraphsForEachDiameter($n, $edges) {
        $graph = array_fill(0, $n, array_fill(0, $n, 0));
        foreach ($edges as $edge) {
            $graph[$edge[0]][$edge[1]] = 1;
            $graph[$edge[1]][$edge[0]] = 1;
        }
        $res = array_fill(0, $n-1, 0);
        for ($i = 1; $i <= $n; $i++) {
            $depths = array_fill(0, $n, 0);
            $this->dfs($i, $graph, $depths);
            $unique = array_unique($depths);
            foreach ($unique as $d) {
                if ($d > 0) $res[$d-1]++;
            }
        }
        return $res;
    }

    function dfs($node, $graph, &$depths) {
        $depths[$node] = 0;
        foreach ($graph[$node] as $neighbor) {
            if ($depths[$neighbor] == 0) {
                $this->dfs($neighbor, $graph, $depths);
                $depths[$node] = max($depths[$node], $depths[$neighbor] + 1);
            }
        }
    }
}

function ladderLength($beginWord, $endWord, $wordList) {
    $wordSet = $wordList;
    if (!in_array($endWord, $wordSet)) {
        return 0;
    }
    $queue = new SplQueue();
    $queue->enqueue([$beginWord, 1]);
    while (!$queue->isEmpty()) {
        list($word, $level) = $queue->dequeue();
        if ($word === $endWord) {
            return $level;
        }
        for ($i = 0; $i < strlen($word); $i++) {
            for ($c = 'a'; $c <= 'z'; $c++) {
                $newWord = substr_replace($word, $c, $i, 1);
                if (in_array($newWord, $wordSet)) {
                    $queue->enqueue([$newWord, $level + 1]);
                    $key = array_search($newWord, $wordSet);
                    unset($wordSet[$key]);
                }
            }
        }
    }
    return 0;
}

