        if ($right < count($heap) && $heap[$right]->val < $heap[$min]->val) {
            $min = $right;
        }

        if ($min != $index) {
            $temp = $heap[$min];
            $heap[$min] = $heap[$index];
            $heap[$index] = $temp;
            $this->heapify($heap, $min);
        }
    }
