                if (empty($this->countToLRUKeys[$this->minCount])) {
                    unset($this->countToLRUKeys[$this->minCount]);
                    $this->minCount++;
                }
            }
        }
        $this->keyToValue[$key] = $value;
        $this->keyToCount[$key] = $this->minCount;
        $this->countToLRUKeys[$this->minCount][$key] = true;
    }
}

