function mergeSortedArrays($nums1, $nums2) {
    $result = array();
    $i = 0; // index for nums1
    $j = 0; // index for nums2
    $k = 0; // index for result array

    while ($i < count($nums1) && $j < count($nums2)) {
        if ($nums1[$i] < $nums2[$j]) {
            $result[$k++] = $nums1[$i++];
        } else {
            $result[$k++] = $nums2[$j++];
        }
    }

    // Append remaining elements from nums1 or nums2
    while ($i < count($nums1)) {
        $result[$k++] = $nums1[$i++];
    }
    while ($j < count($nums2)) {
        $result[$k++] = $nums2[$j++];
    }

    // Remove duplicates
    $result = array_unique($result);

    return $result;
}

